import React from 'react';
import { Component } from 'react';

function Cards() {
    return(
        <div class="card-deck">
            <div class="card" styles="width: 20rem;">
                <img class="card-img-top" src="..." alt=""/>
                <div class="card-body">
                    {/* <img class= "cardimg" </img> */}
                    <h4 class="card-title">Elephanté</h4>
                    <p class="card-text">Imagine being an elephant and someone just walks up and cuts off your mf tusks LMAO.</p>
                    <a href="https://stackoverflow.com/questions/41080481/in-reactjs-how-to-invoke-link-click-via-button-press" class="btn btn-primary" role="button">Link Button </a>
                </div>
            </div>
            <div class="card" styles="width: 20rem;">
                <img class="card-img-top" src="..." alt=""/>
                <div class="card-body">
                    {/* <img class= "cardimg" </img> */}
                    <h4 class="card-title">Elephanté</h4>
                    <p class="card-text">Imagine being an elephant and someone just walks up and cuts off your mf tusks LMAO.</p>
                    <a href="https://stackoverflow.com/questions/41080481/in-reactjs-how-to-invoke-link-click-via-button-press" class="btn btn-primary" role="button">Link Button </a>
                </div>
            </div>
            <div class="card" styles="width: 20rem;">
                <img class="card-img-top" src="..." alt=""/>
                <div class="card-body">
                    {/* <img class= "cardimg" </img> */}
                    <h4 class="card-title">Elephanté</h4>
                    <p class="card-text">Imagine being an elephant and someone just walks up and cuts off your mf tusks LMAO.</p>
                    <a href="https://stackoverflow.com/questions/41080481/in-reactjs-how-to-invoke-link-click-via-button-press" class="btn btn-primary" role="button">Link Button </a>
                </div>
            </div>
        ]</div>
    );
}
export default Cards
